
import  React from 'react';
import './index.css';


export default class HomeComponent extends React.Component{
    constructor(props){
        super(props);
        this.state={
            selectedButton:"",
            selectedId:'',
            popupStatus:false
        }
    }
    extraInfoButtonClicked=(e)=>{
        var selected = e.target.textContent;
        var id = e.target.dataset.id;
        this.setState({
            selectedButton:selected,
            selectedId:id,
            popupStatus:true,
            selectedPlace:this.props.places

        })
        document.body.classList.add("overflow");
    }
    popupClose=()=>{
        this.setState({
            popupStatus:false
        })
        document.body.classList.remove("overflow");

    }
    render(){
        var places  = this.props.places;
        var popupStatus = this.state.popupStatus;
        var id = this.state.selectedId;
        var selectedButton = this.state.selectedButton;
        // var location = places[id].name
        return (
            <div className="home-component-holder">
                <div className="logo-background"></div>
                <h1 className="header-discription">PLACES TO VISIT NEAR HYDERABAD WITHIN 200 KMS</h1>
                <div className="swipe-down-button">Swipe Up</div>
                {/* </div> */}
                <div className="component">
                    <div className="backgroung"></div>
                    <div className="component-header">Visiting Places</div>
                    <div className="component-container">
                        {places.map((location,index)=>
                        <div className="distict-name">
                            <div className="distict-name-header">{location.name}</div>
                            <img src={location.url}  className="distict-name-image"/>
                            <div className="distict-place-discription">
                                {location.discription}
                            </div>
                            <div className="buttons-holder">
                                <button className="images-button" onClick={this.extraInfoButtonClicked} data-id={index}>Images</button>
                                <button className="videos-button" onClick={this.extraInfoButtonClicked} data-id={index}>Videos</button>
                            </div>
                        </div>)}
                    </div>
                    {popupStatus && <div>
                        <div className="popup-background">
                            <div className="popup-content-holder">
                                <h1  className="place-name">{places[id].name}</h1>
                                <div className="popup-cross" onClick={this.popupClose}>X</div>
                                <div className="popup-images-holder">
                                    {selectedButton =='Images' && places[id].images.map((link)=>
                                        <img src={link} className="popup-image" />
                                    )}
                                    {selectedButton =='Videos' && <>
                                        <video width="320" height="240"autoPlay>
                                        <source src={places[0].video} type="video/mp4" />
                                        <source src="movie.ogg" type="video/ogg" />
                                      </video>
                                      Video content will coming Soon.........
                                      </>
                                    }
                                </div>
                            </div>
                        </div>
                    </div>}
                </div>
            </div>

        )

    }
}
